    console.log(expense);
  }
  function addFilter(fill){
    console.log("In App.js");
    console.log(fill);
  }
  return (
    <div>
      <NewExpense onAddExpense={addExpenseHandler}></NewExpense>
      <Expense item={expenses} onAddDataFilter={addFilter}/>
    </div>
  );
}

export default App;
